def filter_numbers(numbers, command):
    if command == "even":
        return [num for num in numbers if num % 2 == 0]
    elif command == "odd":
        return [num for num in numbers if num % 2 != 0]
    elif command == "negative":
        return [num for num in numbers if num < 0]
    elif command == "positive":
        return [num for num in numbers if num >= 0]

