			dictionary[translation] = word;
		}
		for (auto a : dictionary) {
			fout << a.first;
			for (int i = 0; i < 20 - a.first.size(); i++) {
				fout << " ";
			}
			fout << a.second << std::endl;
		}
		fin.close();
		fout.close();
	}
