template <typename T> class MutexData {
public:
	using Locker = std::lock_guard<std::recursive_mutex>;
	using UniqueLocker = std::unique_ptr<Locker>;
	using Pair = std::pair<UniqueLocker, T&>;

	Pair get() {
		return {std::make_unique<Locker>(_mutex), _data};
	}

private:
	T _data{};
	std::recursive_mutex _mutex;
};

template <typename T> class AtomicData {
public:
    void set(const T& data) {
        const auto lock = std::lock_guard<std::mutex>(_mutex);
        _data = data;
    }
 
    T get() {
        const auto lock = std::lock_guard<std::mutex>(_mutex);
        return _data;
    }
 
private:
    T _data{};
    std::mutex _mutex;
};
 
