class AdvManager {
    void sort();
    
    private:
        utils::AtomicData<WorkingHours> _wh;
        utils::AtomicData<std::vector<AdvBase::Ptr>> _advs;
}
 
void AdvManager::sort() {
    log(Lev::Info) << __func__ << "()";
 
    auto advs = _advs.get();
    if (advs.empty()) {
        return;
    }
 
    // функция проверки режима работы
    const auto wh = _wh.get();
 
    // функция сортировки массива
    const auto compare = [&wh, this](const AdvBase::Ptr& l, const AdvBase::Ptr& r) {
        // вначале проверяем загружен ли файл
        const auto dl = downloaded(l->data().mediaId);
        const auto dr = downloaded(r->data().mediaId);
        if (dl != dr) {
            return dl > dr;
        }
 
        // разрешен ли ролик режимом работы
        const auto whl = checkWorkingHours(wh, l);
        const auto whr = checkWorkingHours(wh, r);
        if (whl != whr) {
            return whl > whr;
        }
 
        // времена воспроизведения сортируются по возрастанию
        const auto ntl = l->nextTime();
        const auto ntr = r->nextTime();
        if (ntl != ntr) {
            return ntl < ntr;
        }
 
        // если все одинаково, то сортируем по возрастанию playOrder
        const auto pol = l->schedule().playOrder;
        const auto por = r->schedule().playOrder;
        if (pol != por) {
            return pol < por;
        }
 
        return true;
    };
 
    // сортировка массива
    std::sort(advs.begin(), advs.end(), compare);
 
    if (advs != _advs.get()) {
        _advs.set(advs);
    }
 
    print();
    nextTimeChanged(nextTime(), nextPriorTime());
}

